<template>
  <div class="wrap">
    <div class="loginShadow">
      <img src="data:image/gif;base64," alt="" style="margin-top: 100px" width="100%">
    </div>
    <div class="container-fluid">
      <logo title="代理人注册申请"></logo>
    </div>
    <div class="container-fluid input-box">
      <mt-field :attr="{ maxlength: 11 }" placeholder="请输入绑定手机号码" type="tel" v-model="phoneNum"  class="input"></mt-field>
      <mt-field :attr="{ maxlength: 4 }" placeholder="请输入验证码" type="tel" max-length="11" v-model="verificationCode" class="input verificationCode"></mt-field>
      <div class="sendVerificationCode"  id="sendCode" @click="sendVerificationCode()">发送验证码</div>
    </div>
    <div class="container-fluid footer pa">
      <btn text="下一步" id="btn"  @click.native="submit()"></btn>
      <!--<btn text="下一步" id="btn"  @click.native="openWin('SubmittedReview',{phone:1111,code:2222})"></btn>-->
    </div>
  </div>
</template>
<script>
  import { Toast } from 'mint-ui';
  import { Indicator } from 'mint-ui';

  export default {
    name: 'login',
    data () {
      return {
        phoneNum:'',
        verificationCode:'',
        openId:''
      }
    },
    methods:{
      openWin(url,val){
        this.jump('/'+ url +'',val);
      },
      shadowShow(){
        document.getElementsByClassName('loginShadow')[0].style.height = '100%'
      },
      shadowHide(){
        document.getElementsByClassName('loginShadow')[0].style.height = '0%'
        document.getElementsByClassName('loginShadow')[0].style.display = 'none'
      },
      sendVerificationCode(){  //发送验证码
        var vm = this;
        var testPhone=/^(1[345678][0-9]{1})[0-9]{8}$/;
        if(!testPhone.test(vm.phoneNum)){
          Toast({
            message:'请输入正确的手机号',
            position: 'bottom',
            duration: 2000
          });
          return;
        }

        this.$store.dispatch("send_code",{
          codeType:'BIND_AGENT_PHONE',
          phone:vm.phoneNum
        }).then(res=>{
          Toast({
            message:'发送成功',
            position: 'bottom',
            duration: 2000
          });
          vm.countDown('sendCode');
        }).catch(err=>{
          Toast({
            message:err.errMsg?err.errMsg:err.msg,
            position: 'bottom',
            duration: 2000
          });
          }
        )
      },
      submit(){//提交  下一步
        var vm = this;
        var testPhone=/^(1[345678][0-9]{1})[0-9]{8}$/;
        if(!testPhone.test(this.phoneNum)){
          Toast({
            message:'请输入正确的手机号',
            position: 'bottom',
            duration: 2000
          });
          return
        }
        if(!this.verificationCode){
          Toast({
            message:'请输入验证码',
            position: 'bottom',
            duration: 2000
          });
          return
        }
        this.$store.dispatch("check_code",{ //校验验证码
          codeType:'BIND_AGENT_PHONE',
          phone:vm.phoneNum,
          code:vm.verificationCode
        }).then(res=>{
          vm.openWin('SubmittedReview',{phone:vm.phoneNum,code:vm.verificationCode,openId:vm.openId})
        }).catch(err=>{
          Toast({
            message:err.errMsg?err.errMsg:err.msg,
            position: 'bottom',
            duration: 2000
          });
          }
        )
      },
      countDown(objId){ //倒计时
        var vm = this;
        var fun = this.sendVerificationCode;
        vm.sendVerificationCode = false;
        var i = 60;
        var timer = setInterval(function () {
          if(! document.getElementById(objId)){
            clearInterval(timer)
          }
          if(i ==0){
            clearInterval(timer);
            setTimeout(function () {
              document.getElementById(objId).innerHTML = '重新发送';
            },500)
            vm.sendVerificationCode = fun;
          }
          document.getElementById(objId).innerHTML = i;
          i--;
        },1200)
      },
      getToken(){
        var vm = this;
        vm.$store.dispatch("oauth2",{ //微信code 转openid
          code:vm.$route.query.code
        }).then(res=>{
          if(res.openId){
            vm.openId = res.openId;
          }
          if(res.code == 20000){
            this.$store.dispatch("agents",{ //查询代理商信息
            }).then(res=>{
              if(res.agent.type == 0){
                Toast({
                  message:'您已注册过代理商 即将跳转代理商页面..' ,
                  position: 'bottom',
                  duration: 2000
                });
                window.location.href = 'http://wechat.awo123.cn/agent/index.html'
                return
              }
              vm.openWin('home')
            }).catch(err=>{
              if(err.code == 80029){
                Toast({
                  message:JSON.stringify(err.errMsg?err.errMsg:err.msg) ,
                  position: 'bottom',
                  duration: 2000
                });
                vm.openWin('Prompt',{type:2})
              }
              if(err.agent.type == 0){
                Toast({
                  message:'您已注册过代理商 即将跳转代理商页面..' ,
                  position: 'bottom',
                  duration: 2000
                });
                window.location.href = 'http://wechat.awo123.cn/agent/index.html'
                return
              }
                if(err.code == 80027){
                  vm.openWin('SubmittedReview',err)
                }
                Toast({
                  message:JSON.stringify(err.errMsg?err.errMsg:err.msg) ,
                  position: 'bottom',
                  duration: 2000
                });
              }
            );
          }
          vm.$store.state.login = true;
          window.localStorage.setItem('accessToken',res.agentToken.accessToken)
        }).catch(err=>{
            if(err.openId){
              vm.openId = err.openId;
            }

            if(err.code == 80022){
              if(sessionStorage.getItem('parentSn') == 'null' ||  sessionStorage.getItem('parentSn') == null ){
                Toast({
                  message:'Please scan the two-dimensional code for registration',
                  position: 'bottom',
                  duration: 2000
                });
                vm.openWin('Prompt',{type:0})
              }
            }
//                vm.$store.dispatch("agents",{
//                }).then(res=>{
//                }).catch(err=>{
//                    if(err.code == 40003){ //如果账号不存在
//                      if(sessionStorage.getItem('parentSn') == 'null' ||  sessionStorage.getItem('parentSn') == null ){
//                        Toast({
//                          message:'Please scan the two-dimensional code for registration',
//                          position: 'bottom',
//                          duration: 2000
//                        });
//                        vm.openWin('Prompt',{type:0})
//                      }
//                    }
//                  }
//                );
//          Toast({
//            message:err.errMsg?err.errMsg:err.msg,
//            position: 'bottom',
//            duration: 2000
//          });
          }
        );
      }

    },
    mounted(){
      var vm = this;
//    vm.$store.dispatch("agents",{
//    }).then(res=>{
//    }).catch(err=>{
//        if(err.code == 40003){ //如果账号不存在
//          if(sessionStorage.getItem('parentSn') == 'null' ||  sessionStorage.getItem('parentSn') == null ){
//            Toast({
//              message:'Please scan the two-dimensional code for registration',
//              position: 'bottom',
//              duration: 2000
//            });
//            vm.openWin('Prompt',{type:0})
//          }
//        }
//      }
//    );
      this.getToken();
      this.shadowShow();
      setTimeout(function () {
        vm.shadowHide();
      },2000)
    }
  }


</script>

